export const getItems = (idCategory) => {

  const productsList = idCategory ? Data.filter(product => product.category === idCategory ) : Data

  return new Promise((resolve, reject) => {
    setTimeout(() => {
      Data.length > 0 ?
        resolve(productsList)
        : 
        reject("No hay datos")
    }, 500
    )
  })
}

export const getItemById = (idItem) => {
  console.log("IdItem Desde Data: ", idItem);
  const itemId = parseInt(idItem); // Convertir a número
  const productSelected = idItem ? Data.find(product => product.id === itemId) : null;

  return new Promise((resolve, reject) => {
    setTimeout(() => {
      productSelected ?
        resolve(productSelected)
        : 
        reject("No hay datos");
    }, 500);
  });
}

